(1, 3, 5, 57, 'What is Computer', 'Computer', 'A computer is a machine that can be instructed to carry out sequences of arithmetic or logical operations automatically via computer programming. Modern computers have the ability to follow generalized sets of operations, called programs. These programs enable computers to perform an extremely wide range of tasks. A \"complete\" computer including the hardware, the operating system (main software), and peripheral equipment required and used for \"full\" operation can be referred to as a computer system. This term may as well be used for a group of computers that are connected and work together, in particular a computer network or computer cluster.\n\n ', 'wtos-images/504254_comp.jpg', '', 'https://www.youtube.com/watch?v=mCq8-xTH7jA', '2020-07-26 12:00:00', 'Yes', 345895343, '223419', 'https://en.wikipedia.org/wiki/Computer', 'Computer Class', '12:25', 'active', '2020-07-24 07:10:31', 38, 38, '2020-07-24 07:11:49'),
(2, 1, 9, 101, 'Gravity', '', 'Gravity is a natural force .', '', '', '', '0000-00-00 00:00:00', 'No', 0, '', '', '', '', 'inactive', '2020-08-11 01:26:19', 38, 38, '2020-08-11 01:26:19'),
(4, 1, 9, 0, 'আপেক্ষিক তাপ ও ক্যালোরিমিতি', 'আপেক্ষিক তাপ ও ক্যালোরিমিতি, আপেক্ষিক তাপ, Apekkhik Tap, Calorimetry', 'তাপ সম্পর্কে আলোচনার শুরুতেই যেটা জানা দরকার তা হল তাপ কি?\n\nতাপ হল একপ্রকার শক্তি, এই শক্তি কোন যান্ত্রিক পদ্ধতি ছাড়াই এক বস্তু থেকে অন্য বস্তুতে সঞ্চালিত হতে পারে। এই শক্তি গ্রহণ করলে বস্তু গরম বা বর্জন করলে ঠাণ্ডা হয়ে যায় যা আমরা অনুভব করতে পারি।\n\nএখন এই যে ঠাণ্ডা বা গরমের অনুভূতি সেটা কিন্তু তাপ নয়। সেই অনুভূতি আসলে তাপমাত্রা।\n\nবর্তমানে আমরা তাপমাত্রা সম্পর্কে আলোচনা স্থগিত রেখে কেবল তাপ বিষয়েই সীমাবদ্ধ থাকব।\n\nযাই হোক, তাপ একপ্রকার ভৌত পরিমাপযোগ্য রাশি, তবে বস্তুর তাপ আমরা সরাসরি মাপতে পারি না।\n\nবস্তু যখন তাপ গ্রহন বা বর্জন করে তখন তার উষ্ণতা বা তাপমাত্রা বৃদ্ধি বা হ্রাস পায়। উষ্ণতার এই হ্রাস বৃদ্ধি থেকেই আমরা তাপের পরিমাপ করে থাকি।\nতাপ পরিমাপন\n\nধরা যাক m ভরের কোন একটি বস্তু t1°C উষ্ণতায় রয়েছে। এখন বস্তুটির উষ্ণতা যদি বৃদ্ধি পেয়ে t2°C হয় তবে বস্তু দ্বারা গৃহীত তাপের পরিমান H = m . S. (t2 – t1) °C\n\nউপরোক্ত সম্পর্কে S হল পদার্থের আপেক্ষিক তাপ।\n\nএকইভাবে যদি বস্তুর উষ্ণতা হ্রাস পেয়ে t3°C হয়। তবে বস্তু দ্বারা বর্জিত তাপের পরিমান হবে H = m . S. (t1 – t3) °C\nএখন জানা দরকার আপেক্ষিক তাপ কি?\n\nআমরা বস্তু দ্বারা গৃহীত বা বর্জিত তাপের যে সূত্রটা পেয়েছি সেটা হল –\n\nH = m × S × t [এক্ষেত্রে (t2 – t1) বা (t1 – t3) কে t ধরে নেওয়া হয়েছে]\n\nএক্ষেত্রে H = বস্তু দ্বারা গৃহীত তাপের পরিমান\n\nm = বস্তুর ভর\n\nএবং,  t = তাপ গ্রহণ বা বর্জনের ফলে বস্তুতে সৃষ্ট উষ্ণতার পার্থক্য\n\nএখন m এবং t যদি একক হয় তবে S = H\n\n    অর্থাৎ একক ভরের কোন বস্তুতে একক উষ্ণতার পার্থক্য সৃষ্টির জন্য যে পরিমান তাপ দিতে হবে বা বর্জন করতে হবে সেই পরিমান তাপকেই ঐ বস্তু বা পদার্থটির আপেক্ষিক তাপ বলে।\n\nক্যালোরিমিতি (Calorimetry)\n\nএখন ধরা যাক ‘A’ বস্তু ‘B’ বস্তু পরস্পর স্পর্শ করে আছে।\n\nএখন A এর উষ্ণতা যদি B অপেক্ষা বেশি হয় তবে A এর মধ্যে থাকা তাপ B এর দিকে প্রবাহিত হতে থাকবে। এই তাপ প্রবাহ ততক্ষণ চলবে যতক্ষণ না A ও B বস্তুর তাপমাত্রা সমান হচ্ছে।\n\nসুতরাং বোঝাই যাচ্ছে যে A বস্তু থেকে তাপ বর্জিত হচ্ছে এবং B বস্তুতে তাপ গৃহীত হচ্ছে; এই গৃহীত বা বর্জিত তাপের পরিমাণকেই ক্যালোরিমিতি নামে অভিহিত করা হয়।\nক্যালোরিমিতির মূল নীতি\n\nক্যালোরিমিতির মূলনীতিটি হল, গৃহীত তাপ = বর্জিত তাপ\n\nঅর্থাৎ, সংস্পর্শ যুক্ত একাধিক বস্তু যদি ভিন্ন তাপমাত্রায় থাকে তবে অধিক তাপমাত্রা বিশিষ্ট বস্তুর দ্বারা তাপ বর্জিত হবে এবং এই বর্জিত তাপই নিম্ন তাপমাত্রা বিশিষ্ট বস্তু দ্বারা গৃহীত হবে।\n\n    শেষে আরও একটি কথা অবশ্যই বলা প্রয়োজন যে, এই তাপ গ্রহণ বা বর্জনের মাধ্যমে সবকটি বস্তুই একই তাপমাত্রায় উপনীত হবে এবং এই অবস্থায় আসার পর আর কোন তাপ প্রবাহ ঘটবে না।\n\n\n\n\n\n\n\n\n\n\n', 'wtos-images/562990_Calorimetry-in-bengali.webp', '', '<iframe style=\'width:100%\' height=\'480\' src=\'https://www.youtube.com/embed/n6zmXuuemAw\' frameborder=\'0\' allow=\'accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\' allowfullscreen></iframe>', '2020-08-15 12:00:00', 'Yes', 123, '123', 'xyz', '', '11AM', 'active', '2020-08-11 02:41:45', 38, 38, '2020-08-11 07:17:49'),
(5, 6, 11, 16, 'নুন', 'নুন, Nun', '\nকবি- জয় গোস্বামীর ‘নুন’ কবিতাটি “দিন আনি দিন খাই” মানুষের যন্ত্রণাময় জীবনযাপনের দিনলিপি। আর্থিকভাবে অসচ্ছল এইসব মানুষেরা “অল্পেই খুশি”। যত দিন যায় তাদের না-পাওয়ার অংকটা বাড়তেই থাকে, তবু তারা সগর্বে বলে- “কী হবে দুঃখ করে?” অসুখ করলে তাদের ধার করা ছাড়া উপায় থাকে না; কখনো অর্থাভাবে নিরন্ন দিন কাটাতে হয়। এইসব দুঃখ-কষ্ট যেন তাদের গা-সওয়া হয়ে গেছে। মাঝে মাঝে দুঃখ ভোলার জন্য তারা গঞ্জিকা সেবন করে ঠিকই, কিন্তু সেটাও রাতের অন্ধকারে। সেইজন্য ভদ্রসমাজ তাদের দুঃখটা ঠিক বুঝতে পারেনা।\n\nতারপর একদিন সহ্যের সীমা মাত্রা অতিক্রম করে যায়। সারাদিন হাড়ভাঙ্গা খাটুনির পর রাত্রিবেলায় খেতে বসে যখন ঠাণ্ডা ভাতে নুনটুকু জোটে না তখন রাগ হওয়াই স্বাভাবিক। রাগ ক্রমশ বাড়তে থাকে। এতদিন ধরে না-পাওয়ার যন্ত্রনা ক্ষোভে পরিণত হয় এবং তাদের ক্ষোভের কথা পাড়ার ভদ্র-অভদ্র কারো জানতে বাকি থাকে না। কথকের ভাষায়-\n“বাপ-ব্যাটা দু’ভাই মিলে সারা পাড়া মাথায় করি।”\nএভাবেই ক্ষুধার জ্বালা তাদের লোকলজ্জার কথা ভুলিয়ে দেয়। রাগ প্রশমিত হলে, সমাজের কাছে তারা অকপটে দাবি জানায়-\n“আমাদের শুকনো পাতে লবণের ব্যবস্থা হোক”।\n', 'wtos-images/185909_IMG_20181202_132602.webp', '', '<iframe width=100% width=\"853\" height=\"480\" src=\"https://www.youtube.com/embed/SKbQFozeaHw\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '2020-08-15 12:00:00', 'Yes', 111, '111', 'abc', '', '12-30PM', 'active', '2020-08-11 07:45:34', 38, 38, '2020-08-11 08:11:37');
