(17, 'Mark Sheet', 'Active', 'MarkSheet', 'marksheet_template_1.php', '<style>\n    .pritTemplate{\n        height:auto;\n        max-width:1100px;\n        min-width: 700px;\n        border-radius:10px;\n        padding:60px;\n        background-image:url(__background__);\n        background-position: center;\n        background-repeat: no-repeat;\n        background-size:cover;\n        font-size:12px; font-family:Verdana, Arial, Helvetica, sans-serif; letter-spacing:1px;\n    position: relative}\n\n    .pritTemplate *{\n        box-sizing: border-box;;\n    }\n    .header{\n        text-align: center;\n        position: relative;\n        min-height: 150px;\n    }\n    h1.school_name{\n        font-size: 30px;\n        text-align: center;\n        margin-top: 10px;\n    }\n    img.logo{\n        height: 110px;\n    }\n\n    .exam_block{\n        text-align: center;\n        background-color: rgba(0,0,0,0.03);\n        color: #0A246A;\n        font-size: 14px;\n        margin: 20px 0;\n    }\n\n    .student_info_block table{\n        border-collapse: collapse;\n    }\n    .student_info_block table td:nth-child(1),\n    .student_info_block table td:nth-child(4)\n    {\n        width: 150px;\n        white-space: nowrap;\n\n    }\n    .student_info_block table td:nth-child(4){\n        padding-left: 30px;\n    }\n    .student_info_block table td:nth-child(3),\n    .student_info_block table td:nth-child(6)\n    {\n        color: #0A246A;\n        white-space: nowrap;\n\n    }\n\n    .student_info_block table td:nth-child(2),\n    .student_info_block table td:nth-child(5)\n    {\n        width: 20px !important;\n        padding: 0 10px;\n\n    }\n\n\n\n    .result_block{\n        margin: 20px 0;\n    }\n    .result_block table{\n        border-collapse: collapse;\n    }\n    .result_block th, .result_block td{\n        border:1px solid #000;\n        padding: 2px 3px;\n    }\n    .result_block thead{\n        background-color: #e5e5e5;\n        text-align: left;\n    