(4, 0, 'inbound_sales_processing', 'https://www.linkedin.com/nhome/updates?activity=6209482141256990720&goback=&trk=hb_ntf_COMMENTED_ON_UPDATE_YOU_COMMENTED_ON\r\n\r\nSEEKING INBOUND CALL-CENTER FOR \r\n\r\nDATA-ENTRY Looking for an Inbound \r\n\r\nSales Processing Center On Shore: \r\n\r\nPreferred Off Shore: Possible Must \r\n\r\nbe able to process sales orders \r\n\r\nfrom live customers calling in. \r\n\r\nLive sales agents will be in the \r\n\r\nfield with customer while call \r\n\r\ncenter is entering order. We \r\n\r\nshould need around 5-10 seats to \r\n\r\nstart. Please inbox me or reply \r\n\r\nwith your physical location and \r\n\r\ncapabilities.\r\n', 1, '2016-12-15 05:42:47', '26'),
