(48, 'Notice for Admission 2019', '', '', 0, 'Active', 26, '2018-11-21 07:44:09', 1, 1, '', '2019-02-24 12:00:00', '<p>1. Application forms are available <strong><span style=\"color: #008000;\">ONLINE.<br /><br /></span></strong><span style=\"color: #008000;\"><span style=\"color: #000000;\">2. You may fill the form online. Please take two (2) printouts of form. Keep one copy with yourself and deposit another copy of the form along with the xerox copy of (a) Aadhaar Card, (b) Birth Certificate, (c) Bank Passbook, <span style=\"color: #0000ff;\">(d) Previous result and Transfer Certificate (ONLY FOR NEW ADMISSION).<br /><br /></span></span><span style=\"color: #000000;\">3. Incorrect or Incomplete forms will be considered <strong><span style=\"text-decoration: underline;\"><span style=\"color: #ff0000; text-decoration: underline;\">Invalid.</span></span></strong></span><br /></span></p>'),
(49, 'Re-admission Notice for the class V to IX', '', '', 0, 'Inactive', 26, '2018-12-08 05:24:35', 1, 1, 'Super Admin', '2018-12-08 12:00:00', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; All the students &amp; the guardians of Jibanti Azad Mission are do hereby notified that the mission will be conducted in the following schedule below:<br /><br /><br /></p>\r\n<table style=\"margin-left: auto; margin-right: auto;\" border=\"0\" cellpadding=\"8\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Class</td>\r\n<td>Closing Date&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n<td>Result Out</td>\r\n<td>Re-admission Date&nbsp; &nbsp;</td>\r\n<td style=\"text-align: center;\">Re-admission Fees</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: left;\">V</td>\r\n<td style=\"text-align: left;\">09.12.2018&nbsp;</td>\r\n<td>24.12.2018&nbsp;</td>\r\n<td>24.12.2018&nbsp; &nbsp;to&nbsp; &nbsp;27.12.2018&nbsp;</td>\r\n<td style=\"text-align: center;\">-</td>\r\n</tr>\r\n<tr>\r\n<td>VI</td>\r\n<td>09.12.2018</td>\r\n<td>24.12.2018&nbsp;</td>\r\n<td>24.12.2018&nbsp; &nbsp;to&nbsp; &nbsp;27.12.2018&nbsp;</td>\r\n<td style=\"text-align: center;\">5,000/-&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>VII</td>\r\n<td style=\"text-align: left;\">16.12.2018</td>\r\n<td>24.12.2018&nbsp;&nbsp;</td>\r\n<td>24.12.2018&nbsp; &nbsp;to&nbsp; &nbsp;27.12.2018&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">5,000/-&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>VIII&nbsp;</td>\r\n<td style=\"text-align: left;\"><span>16.12.2018</span></td>\r\n<td>24.12.2018&nbsp;&nbsp;</td>\r\n<td>24.12.2018&nbsp; &nbsp;to&nbsp; &nbsp;27.12.2018&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">5,000/-&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>IX&nbsp;</td>\r\n<td style=\"text-align: left;\"><span>16.12.2018</span></td>\r\n<td>24.12.2018&nbsp;&nbsp;</td>\r\n<td>24.12.2018&nbsp; &nbsp;to&nbsp; &nbsp;27.12.2018&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">6,000/-&nbsp;</td>\r\n</t