(26, 'HOME', '<h2>Welcome to Al-Ameen Mission:</h2>\r\n<p class=\"uk-text-justify\">Almost three decades back, in a remote corner of West Bengal, a group of people led by M Nurul Islam came together and dared to walk in an untraveled path. They wanted to transform the lacklustre minority community into a vibrant and throbbing one. They were absolutely certain that education was the only tool to uplift the morale of the whole community and make a turnaround.</p>\r\n<p class=\"uk-text-justify\">Thus, Al-Ameen Mission came into being. The Mission withstood many rough weathers and held its head high. More than 20 thousand students have gone through the rigorous training of the Mission and so many of them are glorifying the society at present through their works and actions.</p>\r\n<p class=\"uk-text-justify\">A seed which was planted in a remote village have now grown into a gigantic tree and is still growing. It has now 67 institutes including 41 residential campuses spread throughout West Bengal and neighbouring states of Assam and Jharkhand with more than 12 thousand students.</p>\r\n<p><br /><br /><br /><img src=\"../wtos-images/225012_index.jpg\" alt=\"\" /></p>', 1, 'Jibanti Azad Mission', 'Jibanti Azad Mission', 33, 0, '2020-07-06 03:24:22', '0', '', '', 'home', '', 1, 'Home', 0, 1, 0, 'wtos-images/473192_DSC_0004.jpg', 1, 1, '', 'Jibanti Azad Mission', 'Yes', 0),
(27, 'About Us', '<p>&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Overcoming many barriers or obstacles, the happy journey of Arunim Mission started in 1996. Prof. Abu Sufian Sk, founder of the institution, who tried to build a vast pool of learning, wisdom, art and culture in the inner heart of the numerous students. He transformed this education institution into a traditional institution with the sincere co-operation and generosity of other honourable teachers.<br /><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;In 2009 Mustak Hossain extended all-round support to this educational institution. In his financial support Arunim Mission converted to Jibanti Azad Mission. Today Jibanti Azad Mission has become a well-known educational organization in a beautiful ambience of nature. Now Jibanti Azad Mission is progressing with science-based education in keeping with the modern world.</p>', 1, 'About Us', 'About Us', 34, 0, '2020-07-15 04:32:43', '0', '', '', 'AboutUs', '', 2, 'About Us', 1, 1, 0, 'wtos-images/800121_DSC_0004.jpg', 0, 1, '', 'About Us', 'No', 0),
(31, 'Contact Us', '<div class=\"uk-grid uk-grid-match\">\r\n<div class=\" uk-width-expand@m\">\r\n<div class=\"uk-flex uk-flex-middle\">\r\n<div class=\"body_contain\">\r\n<h2>Contact Form</h2>\r\nwtpage-contactUs-Page.php-wtpage</div>\r\n</div>\r\n</div>\r\n<div class=\"uk-width-auto@m uk-flex-first\">\r\n<div class=\"uk-card primary-background uk-light uk-border-rounded\">\r\n<div class=\"uk-card-body\">\r\n<h2 class=\"uk-card-title\">Contact Infomation</h2>\r\n<div class=\"uk-margin\">\r\n<h4 class=\"uk-margin-remove\">Address</h4>\r\n<p class=\"uk-margin-remove\"><strong>ESCHOOL </strong><br /> NP 210,Saltlake,Sector V<br /> Kolkata,West Bengal, 700102</p>\r\n</div>\r\n<div class=\"uk-margin\">\r\n<h4 class=\"uk-margin-remove\">Email Address</h4>\r\n<p class=\"uk-margin-remove\">General :<a href=\"malito:info@eschool.com\">info@eschool.com</a></p>\r\n<p class=\"uk-margin-remove\">Office :<a href=\"malito:info@eschool.com\">info@eschool.com</a></p>\r\n</div>\r\n<div class=\"uk-margin\">\r\n<h4 class=\"uk-margin-remove\">Phone Number</h4>\r\n<p class=\"uk-margin-remove\">Mobile : +91 8017477871</p>\r\n</div>\r\n<div class=\"uk-margin\">\r\n<h4 class=\"uk-margin-remove\">Website</h4>\r\n<p class=\"uk-margin-remove\">Web : <a href=\"www.eschool.com\">www.eschool.com</a></p>\r\n</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 1, 'CONTACT US', 'CONTACT US', 34, 0, '2020-07-15 04:33:32', '0', '', '', 'ContactUs', '', 8, 'CONTACT US', 1, 1, 0, '', 0, 1, '', 'CONTACT US', 'No', 0),
